import "./footer.css";
import telegram from "./../../../img/icons/Telegram.svg";
import email from "./../../../img/icons/Email.svg";
import github from "./../../../img/icons/Github.svg";
import { Link } from "react-router-dom";
function Footer() {
  return (
    <footer>
      <div className="footer-line"></div>
      <div className="main">
        <div className="text">
          <p className="desc">uzbedev@gmail.com</p>
          <p className="ldesc">Web Full Stack Developer</p>
        </div>
        <div className="media">
          <p className="title">Media</p>
          <div className="social">
            <Link to="https://t.me/Network_Person">
              <img src={telegram} alt="telegram icon" />
            </Link>
            <a href="mailto:uzbedev@gmail.com?subject=Assalamu%20of%20the%20email&body=Body%20of%20the%20email">
              <img src={email} alt="email icon" />
            </a>
            <Link>
              <img src={github} alt="github ico" />
            </Link>
          </div>
        </div>
      </div>
    </footer>
  );
}
export default Footer;
